import config from '@/config';
import Generator from '@/webApi/generator'
export default new Generator({
     //查询省信息
     GetAllProvinceList: {url: '/DictAreaService/GetAllProvinceList', method: 'get'},
     //查询省的城市信息
     GetCityOfProvinceList:{url:'/DictAreaService/GetCityOfProvinceList',method:'post'}
}, config.pgyerApiUrl);
